import React from 'react'
import { Image as AntdImage } from 'antd'

export default class LazyImage extends React.Component {

    state = {
        imgUrl: "",
        loadingImg: "data:image/png;base64,",
        errorImg: "data:image/png;base64,"
    }


    initImg() {
        let img = new Image();
        img.src = this.props.src;
        img.onload = () => {
            this.setState({
                imgUrl:this.props.src
            })
        };
        img.onerror = () => {
            this.setState({
                imgUrl:this.state.errorImg
            })
        };
    }

    componentDidMount() {
        this.setState({
            imgUrl:this.state.loadingImg
        })
        this.initImg()
    }


    render() {
        return <AntdImage width={this.props.width} src={this.state.imgUrl} alt={this.props.alt || ''} />
    }
}